import React from 'react'
import Modal from '../Modal.js'
import history from '../../history'


const StreamDelete = () => {
	return(
		<div>
			StreamDelete
			<Modal header="Delete Stream" content="Are you sure" primary="Delete" secondary="Cancel" onClick={onClick}/>
		</div>

	)

}

const onClick = () => {
	history.push('/')
} 

export default StreamDelete;
